  // }

  return (
    <div>

      <div className="auth-column">
        Main page
      </div>

      <BrowserRouter>
        <Routes>

          <Route path="*" element={<TestPage />} />
          <Route path="/login" element={<LoginPage />} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
